import React, { useRef, useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/swiper.min.css";
import "swiper/components/effect-coverflow/effect-coverflow.min.css";
import "swiper/components/pagination/pagination.min.css";

import classes from "./Project.module.css";

// import Swiper core and required modules
import SwiperCore, { EffectCoverflow, Pagination } from "swiper/core";

// install Swiper modules
SwiperCore.use([EffectCoverflow, Pagination]);




function Project() {

  return <div className={classes.project}>
      <Swiper
        effect={"coverflow"}
        grabCursor={true}
        centeredSlides={true}
        slidesPerView={"auto"}
        coverflowEffect={{
          rotate: 50,
          stretch: 0,
          depth: 100,
          modifier: 1,
          slideShadows: true,
        }}
        pagination={true}
        className={`${classes.mySwiper} ${classes["swiper-container"]}`}
      >
        <SwiperSlide className={classes["swiper-slide"]}>
          <img src="https://swiperjs.com/demos/images/nature-2.jpg" alt="yes"/>
          <div className={classes.info}>
            <h1 className={classes.title}>Title</h1>
            <p className={classes.description}>This is my website</p>
          </div> 
          <div className={classes.corner}>CLICK</div>
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://swiperjs.com/demos/images/nature-3.jpg" alt="yes"/>
          <div className={classes.info}>How are you</div>
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://swiperjs.com/demos/images/nature-4.jpg" alt="yes"/>
          <div className={classes.info}>How are you</div>
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://swiperjs.com/demos/images/nature-5.jpg" alt="yes"/>
          <div className={classes.info}>How are you</div>
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://swiperjs.com/demos/images/nature-6.jpg" alt="yes"/>
          <div className={classes.info}>How are you</div>
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://swiperjs.com/demos/images/nature-7.jpg" alt="yes"/>
          <div className={classes.info}>How are you</div>
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://swiperjs.com/demos/images/nature-8.jpg" alt="yes"/>
          <div className={classes.info}>How are you</div>
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://swiperjs.com/demos/images/nature-9.jpg" alt="yes"/>
          <div className={classes.info}>How are you</div>
        </SwiperSlide>
      </Swiper>
    </div>
}

export default Project;
